import React from 'react';
import styled from 'styled-components';

const NoTasksMessage = styled.div`
  grid-column: 1 / -1;
  text-align: center;
  font-size: 18px;
  color: #888;
`;

const NoTasks = () => (
  <NoTasksMessage>Você não tem tarefas pendentes!</NoTasksMessage>
);

export default NoTasks;
